theme.css:
th, td {
  border-top-color: rgb(0, 255, 0);
  border-right-color: rgb(0, 255, 0);
  border-bottom-color: rgb(0, 255, 0);
  border-left-color: rgb(0, 255, 0);
  border-color: rgb(0, 255, 0);
}

.chain table th:first-child {
  background-color: rgb(9, 30, 1);
  color: rgb(43, 214, 31);
}

.chain table tr:first-child th {
  background-color: rgb(12, 59, 2);
  color: rgb(58, 223, 69);
}

.cell {
  background-color: rgb(0, 0, 0);
  color: rgb(69, 181, 28);
}

.x-mark {
  stroke: rgb(0, 255, 0);
}

body {
  background-color: rgb(38, 97, 10);
}

.chain-bg {
  fill: rgb(110, 208, 57);
}

.main-frame {
  background-color: rgba(0, 0, 0, 0.733);
  border-top-color: rgba(54, 129, 63, 0.62);
  border-right-color: rgba(54, 129, 63, 0.62);
  border-bottom-color: rgba(54, 129, 63, 0.62);
  border-left-color: rgba(54, 129, 63, 0.62);
  border-color: rgba(54, 129, 63, 0.62);
}

.main-title {
  color: rgb(64, 231, 4);
}

.btn-toggle-menu {
  color: rgb(5, 184, 35);
  border-top-color: rgb(59, 154, 14);
  border-right-color: rgb(59, 154, 14);
  border-bottom-color: rgb(59, 154, 14);
  border-left-color: rgb(59, 154, 14);
  border-color: rgb(59, 154, 14);
}

.hr-line {
  border-top-color: rgb(22, 125, 8);
  border-right-color: rgb(22, 125, 8);
  border-bottom-color: rgb(22, 125, 8);
  border-left-color: rgb(22, 125, 8);
  border-color: rgb(22, 125, 8);
}

.form-titles {
  color: rgb(93, 255, 5);
}

.selections label {
  color: rgb(23, 232, 103);
  border-top-color: rgb(15, 240, 60);
  border-right-color: rgb(15, 240, 60);
  border-bottom-color: rgb(15, 240, 60);
  border-left-color: rgb(15, 240, 60);
  border-color: rgb(15, 240, 60);
}

button {
  background-color: rgb(29, 152, 27);
}

#btn-theme-settings {
  color: rgb(28, 77, 10);
  border-top-color: rgb(77, 164, 76);
  border-right-color: rgb(77, 164, 76);
  border-bottom-color: rgb(77, 164, 76);
  border-left-color: rgb(77, 164, 76);
  border-color: rgb(77, 164, 76);
}

#btn-theme-settings:hover {
  background-color: rgba(27, 172, 56, 0.5);
}

#btn-add-chain:hover {
  background-color: rgba(8, 125, 37, 0.5);
}

#btn-load-file {
  color: rgb(0, 0, 0);
  border-top-color: rgb(0, 0, 0);
  border-right-color: rgb(0, 0, 0);
  border-bottom-color: rgb(0, 0, 0);
  border-left-color: rgb(0, 0, 0);
  border-color: rgb(0, 0, 0);
}

#btn-load-file:hover {
  background-color: rgba(17, 138, 15, 0.5);
}

#btn-backup-download {
  color: rgb(0, 0, 0);
  border-top-color: rgb(0, 0, 0);
  border-right-color: rgb(0, 0, 0);
  border-bottom-color: rgb(0, 0, 0);
  border-left-color: rgb(0, 0, 0);
  border-color: rgb(0, 0, 0);
}

#btn-backup-download:hover {
  background-color: rgba(27, 105, 30, 0.5);
}

#btn-reset {
  color: rgb(0, 0, 0);
  border-top-color: rgb(0, 0, 0);
  border-right-color: rgb(0, 0, 0);
  border-bottom-color: rgb(0, 0, 0);
  border-left-color: rgb(0, 0, 0);
  border-color: rgb(0, 0, 0);
}

#btn-reset:hover {
  background-color: rgba(28, 81, 21, 0.5);
}

#btn-delete {
  color: rgb(0, 0, 0);
  border-top-color: rgb(0, 0, 0);
  border-right-color: rgb(0, 0, 0);
  border-bottom-color: rgb(0, 0, 0);
  border-left-color: rgb(0, 0, 0);
  border-color: rgb(0, 0, 0);
}

#btn-delete:hover {
  background-color: rgba(12, 126, 31, 0.5);
}

.chain, .chain-tab.active {
  background-color: rgba(90, 226, 113, 0.576);
  border-top-color: rgba(27, 106, 11, 0.643);
  border-right-color: rgba(27, 106, 11, 0.643);
  border-bottom-color: rgba(27, 106, 11, 0.643);
  border-left-color: rgba(27, 106, 11, 0.643);
  border-color: rgba(27, 106, 11, 0.643);
}

.chain-tab {
  color: rgb(39, 95, 38);
}

.chain-title {
  color: rgb(6, 60, 20);
}

.chain-info {
  color: rgb(95, 218, 78);
}

.question-mark {
  color: rgba(4, 255, 0, 0.5);
}

label:has(input:checked) {
  color: rgb(0, 0, 0);
}

input {
  background-color: rgb(163, 212, 145);
  color: rgb(36, 60, 16);
}

.error-info {
  background-color: rgb(2, 128, 0);
  color: rgb(0, 255, 0);
  border-top-color: rgb(0, 0, 0);
  border-right-color: rgb(0, 0, 0);
  border-bottom-color: rgb(0, 0, 0);
  border-left-color: rgb(0, 0, 0);
  border-color: rgb(0, 0, 0);
}

.extra-info {
  color: rgb(26, 188, 53);
}

.ring-number-box {
  background-color: rgba(45, 54, 38, 0.34);
  border-top-color: rgba(35, 60, 32, 0.62);
  border-right-color: rgba(35, 60, 32, 0.62);
  border-bottom-color: rgba(35, 60, 32, 0.62);
  border-left-color: rgba(35, 60, 32, 0.62);
  border-color: rgba(35, 60, 32, 0.62);
}

.text-total-chain {
  color: rgb(28, 160, 35);
}

#show-count {
  color: rgb(30, 132, 16);
}

.parenthesis {
  color: rgb(105, 180, 95);
}

.size-box > * {
  border-top-color: rgb(73, 193, 77);
  border-right-color: rgb(73, 193, 77);
  border-bottom-color: rgb(73, 193, 77);
  border-left-color: rgb(73, 193, 77);
  border-color: rgb(73, 193, 77);
}

.empty-cell {
  background-color: rgb(24, 58, 8);
}

.month-break-left {
  border-left-color: rgb(0, 0, 0);
}

.year-break-left {
  border-left-color: rgb(59, 255, 5);
}
